import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';


function NavbarComponent() {
    return (

<Navbar bg="light" expand="lg">
  <Navbar.Brand href="#home"><img
    src="/"
    width="30"
    height="30"
    className="d-inline-block align-top"
    alt="Gourmet Games logo"
  /></Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#home">Home</Nav.Link>
      <Nav.Link href="#link">Recipes</Nav.Link>
      <NavDropdown title="Winning Recipes" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Pickles</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Pie</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Caserole</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Submit to Win</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Form inline>
      <FormControl type="text" placeholder="Search" className="mr-sm-2" />
      <Button variant="outline-success">Search</Button>
    </Form>
  </Navbar.Collapse>
</Navbar>
    );
}

export default NavbarComponent;
